function certificatePDFMakeConfig($data) {
    function getCertificateText() {
        /*
        participou do minicurso Introdução ao Cloud Computer na IV Semana Tech, evento promovido pelos 
        cursos de Redes de Computadores e Sistemas para Internet nos dias 00/00/0000 e 00/00/000 perfazendo 
        um total de 00 horas de carga horária.
        */
        var $type = $data.activity_type === "Palestra" ? 'da palestra' : 'do minicurso';
        var $dates = $data.dates.length > 1 ? ', nos dias ' : ', no dia ';
        for (var $i = 0; $i < $data.dates.length; $i++) {
            //caso só tenha uma data
            if ($data.dates.length === 1 && $i === 0) {
                $dates += $data.dates[$i];
            }
            /*
             * caso tenha duas ou mais datas
             */
            // primeira das muitas datas
            else if ($i === 0) {
                $dates += $data.dates[$i];
            }
            //ultima das muitas datas
            else if ($i === $data.dates.length - 1) {
                $dates += ' e ' + $data.dates[$i];
            }
            //datas entre a primeira e última
            else {
                $dates += ', ' + $data.dates[$i];
            }
        }
        var $workload = '4';
        var $text = 'participou ' +
            $type +
            ' ' +
            $data.activity_name +
            ' na IV Semana Tech, evento promovido pelos cursos de Redes de Computadores e Sistemas para Internet' +
            $dates +
            ', perfazendo a carga horária de ' +
            $workload +
            ' horas.';
        return $text;
    }
    function getQRCode(){
        $config = {
            level: 'H',
            size: 150,
            value: $data.validatorURL
        };
        return (new QRious($config)).toDataURL('image/jpeg');
    }
    return {
        title: 'Cerfificado de participção de '+$data.participant_name+' na IV Semana Tech da FAT',
        author: 'Gerado pelo ',
        subject: 'Certificado de participação de evento acadêmico.',
        creator: 'Sistema de Gerenciamento de Eventos Acadêmicos desenvolvido por Ennio Sousa (www.enniosousa.com.br)',
        producer: 'Sistema de Gerenciamento de Eventos Acadêmicos desenvolvido por Ennio Sousa (www.enniosousa.com.br)',
        pageSize: 'A4',
        compress: false,
        pageOrientation: 'landscape',
        background: {
            image: 'background',
            width: '840',

        },
        pageMargins: 90,
        content: [
            //tabela com logos
            {
                style: 'Logos',
                layout: 'noBorders',
                table: {
                    widths: ['*', '*'],
                    body: [
                        [{
                                image: 'logoSemanaTech',
                                width: '140',
                                //link: 'http://' + window.location.hostname
                            },
                            {
                                image: 'logoFAT',
                                width: '110',
                                link: 'http://www.semanatech.com.br/',
                                alignment: 'right',
                            },
                        ]
                    ]
                }
            },
            //texto CERTIFICADO DE PARTICIPAÇÃO
            {
                text: 'CERTIFICADO DE PARTICIPAÇÃO',
                fontSize: 26,
                bold: true,
                margin: [0, 20, 0, 0],
                alignment: 'center',
            },
            {
                text: 'A Faculdade Anísio Teixeira certifica que',
                fontSize: 18,
                margin: [0, 30, 0, 0],
                alignment: 'center',
            },
            {
                text: $data.participant_name,
                fontSize: 30,
                bold: true,
                margin: [0, 10, 0, 0],
                alignment: 'center',
                color: 'gray'
            },
            {
                text: getCertificateText(),
                fontSize: 18,
                margin: [0, 10, 0, 0],
                alignment: 'justify',
            },
        ],
        footer: [

            {
                style: 'Logos',
                layout: 'noBorders',
                margin: [70, -50, 110, 0],
                table: {
                    widths: ['*', 90, 240],
                    body: [
                        [
                            [
								{
                                    image: 'signature',
                                    width: 280,
                                    alignment: 'center',
                                    margin: [0, 0, 0, -29]
                                },
                                {
                                    text: '______________________________________________________',
                                    alignment: 'center',
                                },
                                {
                                    text: 'JAMYLLE SANTANA DA FONSECA',
                                    alignment: 'center'
                                },
                                {
                                    text: 'COORDENADORA DOS CURSOS DE SI E REDES DA FAT',
                                    alignment: 'center'
                                },
                                {
                                    text: 'COORDENADORA GERAL DO EVENTO',
                                    alignment: 'center'
                                }
                            ],
                            {
                                image: 'qrCode',
                                width: 90,
                                margin: [0, -10, 0, 0],
                                link: $data.validatorURL
                            },
                            [{
                                    text: 'Valide este certificado online',
                                    bold: true,
                                },
                                {
                                    text: 'Use um leitor de QR Code, ou acesse o site ' 
                                            + window.location.hostname 
                                            + ' e informe o código do certificado. \n' 
                                            + $data.enrol_code,
                                    alignment: 'justify'
                                },
                            ],
                        ]
                    ]
                }
            },
        ],
        images: {
            background: 'data:image/jpeg;base64,',
            logoFAT: 'data:image/png;base64,',
            logoSemanaTech: 'data:image/png;base64,',
            signature: 'data:image/jpeg;base64,',
            qrCode: getQRCode(),

        }
    }
}

function downloadCertificate($code){
    $.get($certificateURLs.api, {code: $code})
    .done(function($data){
        if($.isEmptyObject($data)){
            $.alert({
                title: 'Não foi possível baixar o certificado!',
                content: 'O certificado não pode ser gerado porque você não esteve presente nesta atividade ou não se inscreveu nela.',
            });
        }
        else{
            $.extend($data, {
                validatorURL: $certificateURLs.validator +'?'+$.param({code: $code})
            });
            var docDefinition = certificatePDFMakeConfig($data);
            pdfMake.createPdf(docDefinition).download($code+'.pdf');
        }
    });
}